[Form]
public class WMSOrder extends FormRun
{
    boolean             firstTime;
    NoYes               showComplete;
    QueryBuildRange     criteriaComplete;
    NoYes               hasShownRecords;

    InventDimCtrl_Frm   inventDimFormSetup;

}

void checkEnableButtons()
{
    wmsOrderTrans.enabled(wmsOrder.RecId);
    inventory.enabled(wmsOrder.RecId);
    functions.enabled(wmsOrder.RecId);
}

void init()
{
    showComplete = NoYes::No;

    if (element.args().caller() && element.args().dataset())
    {
        showComplete = NoYes::Yes;
    }
    else
    if (element.args().lookupField())
    {
        showComplete = NoYes::Yes;
    }

    firstTime = true;

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

edit NoYes showComplete(boolean set, NoYes _showComplete)
{
    if (set)
    {
        showComplete = _showComplete;
        wmsOrder_ds.executeQuery();
    }
    return showComplete;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParm;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init          :
        case InventDimFormDesignUpdate::LinkActive    :
            inventDimParm.initProductDimensionsAllGroups();
            inventDimParm.initSiteDimAllGrp();
            inventDimParm.InventLocationIdFlag = true;
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl::newFromForm(element);
            }
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
        // fall through and do Active as well
        case InventDimFormDesignUpdate::Active        :
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void delete()
{
    if (wmsOrder.Status == WMSOrderStatus::Complete)
    {
        if (Box::yesNo("@SYS70566",DialogButton::No,"@SYS6998","@SYS6998") == 0)
        {
            return;
        }
    }
    super();
}

public void linkActive()
{
    super();

    element.updateDesign(InventDimFormDesignUpdate::LinkActive);
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    if (wmsOrder.RecId)
    {
        hasShownRecords = NoYes::Yes;
    }
    return ret;
}

void init()
{
    QueryBuildRange queryBuildRange;
    super();

    queryBuildRange = this.query().dataSourceTable(tableNum(WMSOrder)).findRange(fieldNum(WMSOrder, Type));

    if (!queryBuildRange)
    {
        queryBuildRange = this.query().dataSourceTable(tableNum(WMSOrder)).addRange(fieldNum(WMSOrder, Type));
    }

    if (queryBuildRange)
    {
        queryBuildRange.value(enum2Value(WMSOrderType::OrderPick));
        queryBuildRange.status(RangeStatus::Hidden);
    }

    criteriaComplete      = this.query().dataSourceTable(tableNum(WMSOrder)).addRange(fieldNum(WMSOrder,Status));
    criteriaComplete.status(RangeStatus::Hidden);

    this.query().dataSourceTable(tableNum(WMSOrder)).addRange(fieldNum(WMSOrder, OrderId));
}

void executeQuery()
{
    criteriaComplete.value(showComplete ? '' : strFmt('!%1', queryValue(WMSOrderStatus::Complete)));

    super();

    if (firstTime)
    {
        firstTime = false;
        if (!wmsOrder)
        {
            wmsOrder_ds.create();
        }
    }

    element.checkEnableButtons();
}

boolean validate()
{
    boolean ret = super();

    if (wmsOrder.Qty <= 0)
    {
        ret = checkFailed("@SYS53673");
    }
    return ret;
}

boolean validateDelete()
{
    return true;
}

int prev()
{
    return wmsOrder_ds.prev();
}

int next()
{
    return wmsOrder_ds.next();
}

int last()
{
    return wmsOrder_ds.last();
}

int first()
{
    return wmsOrder_ds.first();
}

void delete()
{
}

void clicked()
{
    boolean enabled = true;

    if (wmsOrder.Status == WMSOrderStatus::Complete && wmsOrder.InventTransRefId)
    {
        enabled = false;
    }

    inventTrans_button.enabled(enabled);
    super();
}

void clicked()
{
    wmsOrderFinish.enabled(wmsOrder.OrderId && wmsOrder.Status == WMSOrderStatus::New);
    super();
}
